package com.kodnest.javapattern.patternlevel1;

public class pattern23 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=0;i<5;i++) {
			for(int j=0;j<5;j++) {
				System.out.print("*");
				if(i>0) {
					break;
				}
			}
			System.out.println();
			
			
		}

	}

}
